(1, '2022-07-01 20:02:27', '2022-07-01 20:09:55', 'feature', '{\"en\":\"Scan to order\"}', '', '{\"en\":\"Our customers can order from their table by simply scanning a QR code\"}', '86fa8777-2ccd-4f62-b1f9-ba6ef8bd5f4c', NULL, NULL),
(2, '2022-07-01 20:02:27', '2022-07-01 20:11:26', 'feature', '{\"en\":\"Jump start to ordering\"}', '', '{\"en\":\"Choose your dish. The customer order dishes within few seconds\"}', '31ab1d79-bba6-4d8b-a747-9f38ad9aa80d', NULL, NULL),
(3, '2022-07-01 20:02:27', '2022-07-01 20:14:17', 'feature', '{\"en\":\"Serve food when ready\"}', '', '{\"en\":\"Order are sent directly to the kitchen and served to their table.\"}', '5d4c51be-7092-441a-afd3-407d61f3f43d', NULL, NULL),
(7, '2022-07-01 20:02:27', '2022-07-01 20:02:27', 'testimonial', '{\"en\":\"Gabriel Martin\"}', '{\"en\":\"Bistrot Paul Bert, France\"}', '{\"en\":\"We knew that we need tool like this one. And we finally found it. Managing orders faster than ever.\"}', 'http://gotshi.com/social/img/faces/christian.jpg', NULL, NULL),
(8, '2022-07-01 20:02:27', '2022-07-01 20:02:27', 'testimonial', '{\"en\":\"Emma Müller \"}', '{\"en\":\"Amador, Germany\"}', '{\"en\":\"No more 30% fee on food delivery platforms. This is super cheap platforms thant saved us ton of money.  \"}', 'http://gotshi.com/social/img/faces/team-4.jpg', NULL, NULL),
(9, '2022-07-01 20:02:27', '2022-07-01 20:02:27', 'testimonial', '{\"en\":\"John Smith\"}', '{\"en\":\"Brooklyn Taco, USA\"}', '{\"en\":\"We where previously chatting with customers on whatsapp so they can order. This is next level.\"}', 'http://gotshi.com/social/img/faces/michael.jpg', NULL, NULL),
(10, '2022-07-01 20:02:27', '2022-07-01 20:02:27', 'testimonial', '{\"en\":\"Maxim Ivanov\"}', '{\"en\":\"Babushka, Russia\"}', '{\"en\":\"Being able to pay directly in WhatsApp, is so great. And the best of all, money goes directly to us.\"}', 'http://gotshi.com/social/img/faces/team-1.jpg', NULL, NULL),
(11, '2022-07-01 20:02:27', '2022-07-01 20:02:27', 'testimonial', '{\"en\":\"Alexandra Papadopulos\"}', '{\"en\":\"Odyssey, Greece\"}', '{\"en\":\"They have the best digital menu creator. Together with the QR code generator it is best on market\"}', 'http://gotshi.com/social/img/faces/team-3.jpg', NULL, NULL),
(12, '2022-07-01 20:02:27', '2022-07-01 20:02:27', 'testimonial', '{\"en\":\"Maria Santos\"}', '{\"en\":\"Brasa, Brazil\"}', '{\"en\":\"Orders from customers on Facebook, Instagram and web on Whatsapp. Can I ask for more!\"}', 'http://gotshi.com/social/img/faces/team-2.jpg', NULL, NULL),
(13, '2022-07-01 20:02:27', '2022-07-01 20:02:27', 'process', '{\"en\":\"For Customers ordering\"}', NULL, '{\"en\":\"The customer can find the link to the menu of the restaurant on Social platforms, word of mouth via friend or if they scan the QR. After they make their order with the online menu, they are able to send the order directly to Restaurant\'s WhatsApp.\"}', NULL, '', 'Start now'),
(14, '2022-07-01 20:02:27', '2022-07-01 20:02:27', 'process', '{\"en\":\"For Restaurant owners\"}', NULL, '{\"en\":\"The process starts when they hear a new message sound on their WhatsApp. They, or a trained bot can ask questions for details for order and delivery address. The restaurant can also inform how much time will take to deliver the order.\"}', NULL, '', 'Start now');
